CREATE TABLE IF NOT EXISTS DEMO_TEST (
	fString 		VARCHAR(200) NOT NULL PRIMARY KEY,
	fInteger 		INTEGER,
	fLong 			LONG,
	fFloat 			FLOAT,
	fDouble 		DOUBLE,
	fDecimal		DECIMAL(18,4),
	fBoolean		BOOLEAN,
	fDate			DATE,
	fTime			TIME,
	fDateTime		DATETIME
);

