	fID 			INT 			NOT NULL	PRIMARY KEY,
	fName 			VARCHAR(100) 	NOT NULL,
	fParentID 		INT,
	fType 			VARCHAR(10) 	NOT NULL,
	fPostCode 		VARCHAR(20),
